using Fnunez.VeterinaryClinic.ClinicManagement.Application.SharedModel.Patient.CreatePatient;
using Fnunez.VeterinaryClinic.ClinicManagement.Application.SharedModel.Patient.GetPatientDetail;
using Fnunez.VeterinaryClinic.ClinicManagement.Application.SharedModel.Patient.GetPatientEdit;
using Fnunez.VeterinaryClinic.ClinicManagement.Application.SharedModel.Patient.GetPatients;
using Fnunez.VeterinaryClinic.ClinicManagement.Application.SharedModel.Patient.UpdatePatient;
using Fnunez.VeterinaryClinic.ClinicManagement.BlazorClient.Client.Models.Patients;
using Fnunez.VeterinaryClinic.ClinicManagement.BlazorClient.Client.ViewModels.Patients;

namespace Fnunez.VeterinaryClinic.ClinicManagement.BlazorClient.Client.Helpers;

public static class PatientHelper
{
    public static CreatePatientRequest MapCreatePatientRequest(
        AddEditPatientVm addEditPatientVm)
    {
        return new CreatePatientRequest
        {
            Breed = addEditPatientVm.Breed,
            ClientId = addEditPatientVm.ClientId,
            Name = addEditPatientVm.Name,
            PhotoData = addEditPatientVm.PhotoData,
            PhotoName = addEditPatientVm.PhotoName,
            PreferredDoctorId = addEditPatientVm.PreferredDoctorId,
            Sex = (int)addEditPatientVm.Sex!.Value,
            Species = addEditPatientVm.Species
        };
    }

    public static AddEditPatientVm MapAddEditPatientViewModel(
        PatientEditDto patientEditDto)
    {
        return new AddEditPatientVm
        {
            Breed = patientEditDto.Breed,
            ClientId = patientEditDto.ClientId,
            Name = patientEditDto.Name,
            PatientId = patientEditDto.PatientId,
            PhotoData = patientEditDto.PhotoData,
            PhotoName = patientEditDto.PhotoName,
            PreferredDoctorId = patientEditDto.PreferredDoctorId,
            Sex = (AnimalSex)Enum.ToObject(typeof(AnimalSex), patientEditDto.Sex),
            Species = patientEditDto.Species
        };
    }

    public static PatientDetailVm MapPatientDetailViewModel(
        PatientDetailDto patientDetailDto)
    {
        return new PatientDetailVm
        {
            Breed = patientDetailDto.Breed,
            Name = patientDetailDto.Name,
            PhotoBase64Encoded = ConvertPhotoToBase64String(patientDetailDto.PhotoData),
            PhotoName = patientDetailDto.PhotoName,
            PreferredDoctorFullName = patientDetailDto.PreferredDoctorFullName,
            Sex = (AnimalSex)Enum.ToObject(typeof(AnimalSex), patientDetailDto.Sex),
            Species = patientDetailDto.Species
        };
    }

    public static List<PatientsVm> MapPatientsViewModels(
        List<PatientsDto> patientDtos)
    {
        List<PatientsVm> patients = new();

        foreach (var patientDto in patientDtos)
            patients.Add(MapPatientsViewModel(patientDto));

        return patients;
    }

    public static PatientsVm MapPatientsViewModel(PatientsDto patientDto)
    {
        return new PatientsVm
        {
            ClientId = patientDto.ClientId,
            Name = patientDto.Name,
            PatientId = patientDto.PatientId,
            PhotoBase64Encoded = ConvertPhotoToBase64String(patientDto.PhotoData),
            Sex = (AnimalSex)Enum.ToObject(typeof(AnimalSex), patientDto.Sex),
            Species = patientDto.Species
        };
    }

    public static UpdatePatientRequest MapUpdatePatientRequest(
        AddEditPatientVm addEditPatient)
    {
        return new UpdatePatientRequest
        {
            Breed = addEditPatient.Breed,
            ClientId = addEditPatient.ClientId,
            Name = addEditPatient.Name,
            IsNewPhoto = addEditPatient.IsNewPhoto,
            PatientId = addEditPatient.PatientId,
            PhotoData = addEditPatient.PhotoData,
            PhotoName = addEditPatient.PhotoName,
            PreferredDoctorId = addEditPatient.PreferredDoctorId,
            Sex = (int)addEditPatient.Sex!.Value,
            Species = addEditPatient.Species
        };
    }

    private static string ConvertPhotoToBase64String(byte[] photoData)
    {
        try
        {
            return Convert.ToBase64String(photoData);
        }
        catch
        {
            return GetPatientThumbnail();
        }
    }

    public static string GetPatientThumbnail()
    {
        return "";
    }
}